import Home from './Home';
import Alamat from './Alamat';
import Nama from './Nama';
import { Switch, Route, Link } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="Nama">Nama</Link></li>
